uper_speed'),(17,'Hyper Speed','Spawn 10 [NETWORK]Network Components[WHITE]. Gain an extra turn.','new MultiAbility([\n    new SpawnAbility(4, {state, move -> A:{return 10}}, []),\n    new ExtraTurnAbility()\n])','hyper_speed'),(18,'Light Speed','Transform All [POWER]Power Components [WHITE]into [NETWORK]Network Components[WHITE]. Then, there is a 10% chance to double [NETWORK] Network Components','ComponentFilter powerFilter = new ComponentFilter(\"All Power Components\") {\n     public boolean filter(Component c, MatchState state, Move move) { return c.getColor() == 6}\n};\n\nComponentFilter networkFilter = new ComponentFilter(\"All Power Components\") {\n     public boolean filter(Component c, MatchState state, Move move) { return c.getColor() == 4}\n};\n\nnew MultiAbility([\n    new TransformComponentsAbility(\n        [],\n        powerFilter,\n        [4]\n    ),\n    new SpawnAbility(\n        4,\n        {state, move -> A:{\n            if(Math.random() < 0.1){\n                return state.countComponents(networkFilter, move)\n            }\n            else {\n                return 0\n            }\n        }} as StateAnalyzer<Integer>,\n        []\n    )\n])','light_speed'),(19,'TCP Handshake','Deal 2 damage to the first enemy, then 2 damage to this card, then 3 damage to the first enemy.','new ExtraTurnAbility()','tcp_handshake'),(20,'Datagram Message','There is 50% chance to deal 5 damage to a random opponents card.','new ExtraTurnAbility()','datagram'),(21,'Encrypt','Add 3 Defense to All Ally Cards','CardFilter allyCards = new CardFilter(\"Ally Cards\") {\n	public boolean filter(Card c, MatchState s, Move m) {return c.getOwnerUID().equals(m.getPlayerUID())}\n}\n\nnew ChangeDefenseAbility(\n	[],\n	allyCards,\n	{state, move -> A:{return 3}} as StateAnalyzer<Integer>\n)','encrypt'),(22,'Decrypt','Remove 3 Defense from all Opponent Cards','CardFilter opponentCards = new CardFilter(\"Opponent Cards\") {\n	public boolean filter(Card c, MatchState s, Move m)